import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Chat from './pages/Chat';

function App() {
  return (
    //MAIN PAGE
    <div className="App">
      <a>Mumis</a>
      <Route path="chat" element={<Chat/>} />
    </div>
  );
}

export default App;
